UPDATE `temailvorlagesprache` SET `cContentHtml` = 'Sehr {if $Kunde->cAnrede=="w"}geehrte{else}geehrter{/if} {$Kunde->cAnredeLocalized} {$Kunde->cNachname},<br><br>\r\n\r\nmöchten Sie Ihre Erfahrungen mit Ihren kürzlich bei uns erworbenen Produkten mit anderen teilen, so würden wir uns sehr freuen, wenn Sie eine Bewertung abgeben.<br><br>\r\n\r\nZur Abgabe einer Bewertung klicken Sie einfach auf eines Ihrer erworbenen Produkte:<br><br>\r\n\r\n{foreach name=pos from=$Bestellung->Positionen item=Position}\r\n                                <table width="600" border="0" cellspacing="0" cellpadding="0">\r\n                                <tr>\r\n                                        <td valign="top" style="padding-bottom:5px;">\r\n        {if $Position->nPosTyp==1}\r\n                                                <b><a href="{$ShopURL}/index.php?a={$Position->kArtikel}&bewertung_anzeigen=1">{$Position->cName} ({$Position->cArtNr})</a></b>\r\n        <br>\r\n                {foreach name=variationen from=$Position->WarenkorbPosEigenschaftArr item=WKPosEigenschaft}\r\n                                                <br><span class="standard"><b>{$WKPosEigenschaft->cEigenschaftName}</b>: {$WKPosEigenschaft->cEigenschaftWertName}\r\n                                                </span>\r\n                {/foreach}\r\n        {/if}\r\n                                        </td>\r\n                                </tr>\r\n                                </table>\r\n{/foreach}\r\n<br><br>\r\nVielen Dank für Ihre Mühe.<br><br>\r\n\r\n{if $oTrustedShopsBewertenButton->cURL|count_characters > 0}\r\nWaren Sie mit Ihrer Bestellung zufrieden? Dann würden wir uns über eine Empfehlung freuen ... es dauert auch nur eine Minute.<br>\r\n<a href="{$oTrustedShopsBewertenButton->cURL}"><img src="{$oTrustedShopsBewertenButton->cPicURL}" alt="Bewerten Sie uns!"></a><br><br>\r\n{/if}\r\n\r\nMit freundlichem Gruß <br><br>\r\n\r\nIhr Team von {$Firma->cName}', cContentText = 'Sehr {if $Kunde->cAnrede=="w"}geehrte{else}geehrter{/if} {$Kunde->cAnredeLocalized} {$Kunde->cNachname},\r\n\r\nmöchten Sie Ihre Erfahrungen mit Ihren kürzlich bei uns erworbenen Produkten mit anderen teilen, so würden wir uns sehr freuen, wenn Sie eine Bewertung abgeben.\r\n\r\nZur Abgabe einer Bewertung klicken Sie einfach auf eines Ihrer erworbenen Produkte:\r\n\r\n{foreach name=pos from=$Bestellung->Positionen item=Position}\r\n{if $Position->nPosTyp==1}\r\n{$Position->cName} ({$Position->cArtNr})\r\n{$ShopURL}/index.php?a={$Position->kArtikel}&bewertung_anzeigen=1\r\n\r\n{foreach name=variationen from=$Position->WarenkorbPosEigenschaftArr item=WKPosEigenschaft}\r\n                                                \r\n{$WKPosEigenschaft->cEigenschaftName}: {$WKPosEigenschaft->cEigenschaftWertName}\r\n{/foreach}\r\n{/if}\r\n{/foreach}\r\n\r\nVielen Dank für Ihre Mühe.\r\n\r\n{if $oTrustedShopsBewertenButton->cURL|count_characters > 0}\r\nWaren Sie mit Ihrer Bestellung zufrieden? Dann würden wir uns über eine Empfehlung freuen ... es dauert auch nur eine Minute.\r\nBewerten Sie uns unter {$oTrustedShopsBewertenButton->cURL}\r\n{/if}\r\n\r\nMit freundlichem Gruß\r\n\r\nIhr Team von {$Firma->cName}' WHERE `temailvorlagesprache`.`kEmailvorlage` = 15 AND `temailvorlagesprache`.`kSprache` = 1;
